import { Avatar, Card } from "@mui/material";
const Skill = () => {
  return (
    <div className="skill-wrapper">
      <h1 id="skill" className="skill-heading">
        Professional Skillset
      </h1>
      <Card variant="outlined" sx={{ height: 50, width: 50 }} />
    </div>
  );
};
export default Skill;
